import React, { Component } from 'react';
//import {FirebaseDatabaseMutation}
//                         from "@react-firebase/database";
import './page-list-hit.css';

import { config } from "../../../config";
import * as firebase from "firebase/app";

import {
  FirebaseDatabaseProvider,
  FirebaseDatabaseNode,
  FirebaseDatabaseMutation
       } from "@react-firebase/database";
let List=()=>(<li></li>);

export default class PageListHit extends Component {


  render(){
    return(
    <div>
      <div className="send-data">
        <FirebaseDatabaseProvider firebase={firebase} {...config}>
     <FirebaseDatabaseNode path="HS2/" >
       {d => {
         const object = d.value;
         let hitData = [];
         if (object !== null) {
           for (let key in object) {
             if (key === "hits") {
               for (let keyH in object.hits) {
                 hitData.push(object.hits[keyH]);
               }
             }
           } 
         }

         let id=0;
        List = hitData.map((item)=>{
            id ++;
            const {part,power, long, span , time}=item;
            console.log("Check bag");
            /*<li  className="list-group-item li-css">
                    <p>Part {part}, Power {power}, Long {long}, Span {span}, Time {time} </p><br/>
            </li>*/
            return (
              <li id={id} key = {id}  className="list-group-item li-css">hit: {power}</li>
         );}); 
        return (
           <div className='d-flex '> 
             <ul className='list-group  list-group-horizontal '>
               <List/>
              </ul>
           </div>
         );
       }}
     </FirebaseDatabaseNode>
   </FirebaseDatabaseProvider>
   </div>
   </div>
 );
  }

}
